import './Tarefa.css';

export default function Tarefa(props) {
    return (
        <div className="tarefa">
            <div className='dados-tarefa'>
                <input type="checkbox" id="checkbox" /> &nbsp;
                <input type="text" id="titulo-tarefa" placeholder="Título" value={props.dados['titulo']} /> &nbsp;
                <input type="date" id="data" value={props.dados['vencimento']}/> &nbsp;
                <span className="material-icons">delete_forever</span> <br />
            </div>
            <textarea id="descricao" placeholder='Descrição'>{props.dados['descricao']}</textarea>
        </div>
    );
}
